import { Col, Row } from "react-bootstrap";
import {
  TelephoneFill,
  EnvelopePaperHeartFill,
  Shop,
} from "react-bootstrap-icons";

function Contact() {
  return (
    <>
      <h1 className="page-title">Contact</h1>
      <h2 className="page-title">We're here to help.</h2>

      <div>
        <TelephoneFill className="" />

        <h3>Give us a call</h3>
        <p>111-111-1111</p>

        <EnvelopePaperHeartFill />

        <h3>Email</h3>
        <p>royalsavemart@gmail.com</p>

        <Shop fill="black" />

        <h3>Store</h3>
        <p>Open 9am - 9pm 7 days</p>
        <p>147 Nelson street, Auckland Central, Auckland, 1010</p>
      </div>
    </>
  );
}

export default Contact;
